import React from 'react';
import { useRoutes } from "./routes";
import { BrowserRouter } from "react-router-dom"
import { Header } from './components/Header';

export default function App() {
  const routes = useRoutes();

  return (
    <div>
        <Header/>
        <BrowserRouter>
              {routes}
        </BrowserRouter>
    </div>
  );
}

